// JPEG style compression with Daala split filter for deblocking, heightmap of Gran Canaria
//
// See Buffer A for actual stuff, and Buffer B/C and Common for the filter.
//
// This shows the heightmap as an image and a stylistic sunset setting.
// This gives a view of the artifacts in the unforgiving sun side as well as the forgiving shadowed side.
//
// See the forked shader for without deblocking
//
// Uncomment SPLITSCREEN to hide image.
//
// Change iChannel0 to Buffer A to see the blocky data before the filters.
//
// Note: You need at least 512 buffer resolution for the decoded image to fit. So thumbnail will have issues.

#define SPLITSCREEN
#define MULTISAMPLES 1 // Max 4

const float min_stepsize = 0.02;
const float stepfactor = 0.5;
const int maxsteps = 80;

const float zoom = 1.6;

const float pi = 3.1415926326;

const vec3 waterColor = pow(vec3(40, 70, 90) / 255., vec3(2.2));
const vec3 lowLandColor = pow(vec3(133, 115, 94) / 255., vec3(2.2));
const vec3 highLandColor = pow(vec3(60, 96, 69) / 255., vec3(2.2));
const vec3 sunColor = vec3(1, 0.5, 0.1) * 7.0;
const vec3 ambientColor = vec3(.25, .4, 1.) * 2.1;
vec3 sunDir;

float hf(vec2 p)
{
    vec2 uv = clamp(p * 8.0 + vec2(imageSize) * 0.5, vec2(0.0), vec2(imageSize));
    return textureLod(iChannel0, uv / iResolution.xy, 0.0).x / 1020. * 5.;

    // Using power makes it a bit nicer/more dramatic, but from what I can tell the
    // heightmap actually matches reality more as linear
    // This also hides the low precision of lower values
    //return pow(textureLod(iChannel0, uv / iResolution.xy, 0.0).x / 1020., 2.) * 5.;
}

vec4 march_terrain(vec3 p, vec3 d)
{
    for (int i = 0; i < maxsteps; ++i)
    {
        p += d * max(min_stepsize, (p.y - hf(p.xz)) * stepfactor);
       	if (p.y < hf(p.xz))
			return vec4(p, float(i) / float(maxsteps));
    }
    return vec4(p, 1.0);
}

vec3 s(vec3 p, vec3 d)
{
    vec4 r = march_terrain(p, d);
    float dist = length(r.xz);

    // Normal
    float h = hf(r.xz);
    float e = 1./64.; // Change to 1./8. for smooth normals
    vec3 b0 = vec3(e, 1.0 * (hf(r.xz + vec2(e, 0)) - h), 0.);
    vec3 b1 = vec3(0., 1.0 * (hf(r.xz + vec2(0, e)) - h), e);
    vec3 n = normalize(cross(b0, b1));
    if (h < 0.01)
    {
        // Fake normal for the water
        vec2 r = texture(iChannel1, r.zx / 16.).xy * 2.0 - 1.0;
        n = normalize(mix(n, vec3(r.x, -10., r.y), smoothstep(.01, 0., h)));
    }

    // Land color
    vec3 c = mix(lowLandColor, highLandColor, smoothstep(0.1, 2.0, h + texture(iChannel1, r.zx / 128.).r));
    c += (texture(iChannel1, r.zx / 4.).r - 0.5) * 0.5 * c;

    c = mix(c, waterColor, smoothstep(0.1, 0.0, h));

    // Light
    vec4 sr = march_terrain(vec3(r.x, h + .1, r.z), -sunDir);    
    float shadow = length(r.xyz - sr.xyz) > 20. ? 1. : 0.;
    float ao = pow(clamp(h * .2 + dist * .04, 0., 1.2), 1.5);
    vec3 light = shadow * max(0., dot(n, sunDir)) * sunColor + ambientColor * ao;
    vec3 spec = shadow * pow(max(0., dot(reflect(d, n), -sunDir)), 64.) * sunColor * 0.2;
    c = light * c + spec;

    c += vec3(0.12) * r.w; // Step fog
    c += vec3(0.1, 0.01, 0.) * clamp(dist * 0.01 - 0.25, 0., 1255.0); // Surround fog

    return c;
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
#ifdef SPLITSCREEN
    if (fragCoord.x < iResolution.x * 0.5)
    {
        fragColor = texture(iChannel0, fragCoord / iResolution.xy * vec2(imageSize) / iResolution.xy * vec2(2., 1.)) / 1020.;
        return;
    }
    vec2 center = vec2(0.75, 0.5);
    float eyedistance = 70.0;
#else
    vec2 center = vec2(0.5, 0.5);
    float eyedistance = 55.0;
#endif

    float ry = -iMouse.x / iResolution.x * pi * 2.0 + iTime * 0.1;
    float rx = pi * 0.84;
    if (iMouse.xy != vec2(0.0))
        rx = clamp(iMouse.y / iResolution.y * pi * 0.5 + pi * 0.5, pi * 0.5, pi * 0.9);

    vec4 cs = cos(vec4(ry, rx, ry - pi * 0.5, rx - pi * 0.5));
    vec3 forward = -vec3(cs.x * cs.y, cs.w, cs.z * cs.y);
	vec3 up = vec3(cs.x * cs.w, -cs.y, cs.z * cs.w);
	vec3 left = cross(up, forward);
    vec3 eye = -forward * eyedistance + vec3(0, -3, 0);

    // Always put sun diagonally opposed to you for dramatic view
    vec2 sr = cos(ry + pi * .275 - vec2(0, pi * .5));
    sunDir = -normalize(vec3(sr.x, 0.1, sr.y));

    vec2 uv = zoom * (fragCoord.xy - iResolution.xy * center) / iResolution.x;
    vec3 dir = normalize(vec3(forward + uv.y * up + uv.x * left));    
    vec3 color = s(eye, dir);
#if MULTISAMPLES > 1
    vec2 uvh = zoom * vec2(0.5) / iResolution.x;
    color += s(eye, normalize(forward + (uv.y + uvh.y) * up + (uv.x + uvh.x) * left));
#if MULTISAMPLES > 2
    color += s(eye, normalize(forward + (uv.y + uvh.y) * up  + uv.x * left));
#if MULTISAMPLES > 3
    color += s(eye, normalize(forward + uv.y * up + (uv.x + uvh.x) * left));
#endif
#endif
    color /= float(MULTISAMPLES);
#endif
    fragColor = vec4(pow(color, vec3(1./2.2)), 1.0);
}

// Vertical filter, see Common for od_post_filter8

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    ivec2 coord = ivec2(fragCoord);
    if (coord.x >= imageSize.x || coord.y < blockSize / 2 || coord.y >= imageSize.y - blockSize / 2)
    {
        // Should really pass on value in the edge half block but for this image it just happens to be 0
        // and it's nice to clamp edge to 0 to not get bleeding artifacts
        fragColor = vec4(0); //texelFetch(iChannel0, coord, 0);
        return;
    }

    int block_y = (coord.y - blockSize / 2) / blockSize;
    int base_y = block_y * blockSize + blockSize / 2;

    int t[blockSize];
    for (int i = 0; i < blockSize; ++i)
        t[i] = int(texelFetch(iChannel0, ivec2(coord.x, base_y + i), 0).r);
    od_post_filter8(t);

    fragColor = vec4(t[coord.y - base_y]);
}

const ivec2 imageSize = ivec2(512, 512);
const int blockSize = 8;

