/*Optimal 1d subset3 Cg*/
# define OD_FILTER_PARAMS8_0 (93)
# define OD_FILTER_PARAMS8_1 (72)
# define OD_FILTER_PARAMS8_2 (73)
# define OD_FILTER_PARAMS8_3 (78)
# define OD_FILTER_PARAMS8_4 (-28)
# define OD_FILTER_PARAMS8_5 (-23)
# define OD_FILTER_PARAMS8_6 (-10)
# define OD_FILTER_PARAMS8_7 (50)
# define OD_FILTER_PARAMS8_8 (37)
# define OD_FILTER_PARAMS8_9 (23)

void od_post_filter8(inout int _x[8]) {
  int t[8];
  t[7] = _x[0]-_x[7];
  t[6] = _x[1]-_x[6];
  t[5] = _x[2]-_x[5];
  t[4] = _x[3]-_x[4];
  t[3] = _x[3]-(t[4]>>1);
  t[2] = _x[2]-(t[5]>>1);
  t[1] = _x[1]-(t[6]>>1);
  t[0] = _x[0]-(t[7]>>1);
  t[4] -= (t[5]*OD_FILTER_PARAMS8_7+32)>>6;
  t[5] -= (t[4]*OD_FILTER_PARAMS8_4+32)>>6;
  t[5] -= (t[6]*OD_FILTER_PARAMS8_8+32)>>6;
  t[6] -= (t[5]*OD_FILTER_PARAMS8_5+32)>>6;
  t[6] -= (t[7]*OD_FILTER_PARAMS8_9+32)>>6;
  t[7] -= (t[6]*OD_FILTER_PARAMS8_6+32)>>6;
  t[7] = (t[7]<<6)/OD_FILTER_PARAMS8_3;
  t[6] = (t[6]<<6)/OD_FILTER_PARAMS8_2;
  t[5] = (t[5]<<6)/OD_FILTER_PARAMS8_1;
  t[4] = (t[4]<<6)/OD_FILTER_PARAMS8_0;
  t[0] += t[7]>>1;
  _x[0] = t[0];
  t[1] += t[6]>>1;
  _x[1] = t[1];
  t[2] += t[5]>>1;
  _x[2] = t[2];
  t[3] += t[4]>>1;
  _x[3] = t[3];
  _x[4] = t[3]-t[4];
  _x[5] = t[2]-t[5];
  _x[6] = t[1]-t[6];
  _x[7] = t[0]-t[7];
}

// Horizontal filter, see Common for od_post_filter8

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    ivec2 coord = ivec2(fragCoord);
    if (coord.x < blockSize / 2 || coord.x >= imageSize.x - blockSize / 2 || coord.y >= imageSize.y)
    {
        fragColor = vec4(0); //texelFetch(iChannel0, coord, 0);
        return;
    }

    int block_x = (coord.x - blockSize / 2) / blockSize;
    int base_x = block_x * blockSize + blockSize / 2;

    int t[blockSize];
    for (int i = 0; i < blockSize; ++i)
        t[i] = int(texelFetch(iChannel0, ivec2(base_x + i, coord.y), 0).r);
    od_post_filter8(t);

    fragColor = vec4(clamp(t[coord.x - base_x], 0, 1020));
}
